globalCss:
.app-Page-Header,
.app-Settings-Header {
  z-index: 5;
}

.app-Header-Header {
  box-shadow: 0px 5px 8px 0px rgba(0, 0, 0, 0.14), 0px 1px 14px 0px
    rgba(0, 0, 0, 0.12), 0px 3px 5px -1px rgba(0, 0, 0, 0.2);
}

@media (max-width: 800px) {
  .hide-800 {
    display: none;
  }

  .app-Settings-Content,
  .app-Page-Content {
    width: 100% !important;
  }
}

@media (max-width: 600px) {
  .hide-600 {
    display: none;
  }
}

@media (max-width: 480px) {
  .hide-480 {
    display: none;
  }
}
